import Container from '@mui/material/Container';
import Computer from '../assets/mycomputericon.png'
import Popup from 'reactjs-popup';


export function MyComputerGroup(){
    return(
        <Container className='Computer-Container-Properties' maxWidth={false}>
            <ComputerIcon/>
            <ComputerText />
        </Container>
    )
} 

export function ComputerPopUp(){
    <MyComputerGroup>
    <Popup
    trigger={MyComputerGroup}
    position="right center"
    closeOnDocumentClick
    >
    <div>Popup content here !!</div>    
    </Popup>
    </MyComputerGroup>
}

export function ComputerIcon(){
    return(
        <img src={Computer}
        className='Folder-icon'
        alt='Computer icon'
        />
    )
}

export function ComputerText(text){
    text = "My Computer"
    return(
        <p className='FolderText'>
            {text}
        </p>
    )
}
